import React, { Component } from 'react';
import { FaPaw } from "react-icons/fa"

import "./styles.css";
import { Link } from "react-router-dom";
import { PetContext } from "../context";
import Cats from "../pages/Cats";
import Pets from "../pages/Pets";
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom'

export default class SideNav extends Component {
  constructor(props) {
    super(props)
    this.handleClick = this.handleClick.bind(this)
    this.state = {
      typeDog: [],
      typeCat: []
    }

  }
  handleClick = (e) => {
    this.setState = {
      flag: !this.state.flag
    }
  }
  render() {
    var isActive = this.context.router.route.location.pathname === this.props.to;
        var className = isActive ? 'active' : '';
    return (
      <div className="col-md-3 sidenav">
        <h1> <FaPaw />
          <Link to="/">PawPal</Link>
        </h1>
        <div className="text-element content-element circles-list">
          <ol>
            <li className="active"><Link to="/choosepets/">Dogs or Cats??</Link>
            </li>
            <li>
              <Link to="/choosepets/Dogs">Pet Basics </Link><Link to="/choosepets/Cats">Pet Basics </Link>
            </li>
            <li><Link to="/">Pet Details</Link></li>
          </ol>
        </div>

      </div>
    );
  }
}
